  \"Self-Supporting High Performance Multi-Layer Insulation Technology Development
  (SSMLI) Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-06T22:25:40.849571\",\n\t\"name\": \"self-supporting-high-performance-multi-layer-insulation-technology-development-ssmli-proje\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;div&gt;rnt&lt;div&gt;rnttIMLI coupons
  have been outperforming traditional MLI. IMLI has better thermal performance&amp;mdash;with
  some insulating properties improved by up to 37 percent (and analysis indicates
  that this could grow to 73 percent for a full system). IMLI reduces system uncertainty
  in thermal performance and lowers fabrication and installation costs. In addition,
  it has a more durable structure and was not damaged by the high acoustic noise levels
  associated with launching on a rocket.&lt;/div&gt;rn&lt;/div&gt;rn&lt;div&gt;rnt&amp;nbsp;&lt;/div&gt;rn&lt;div&gt;rntIn
  2013, the project conducted two tests with IMLI blankets applied to storage tanks:
  a thermal test and an acoustic test. The tests will have already been completed
  with traditional MLI. NASA Glenn conducted the thermal test in its Small, Multi-Purpose
  Research Facility (SMiRF), which simulates the vacuum and temperature extremes of
  space. The researchers tested IMLI that is supporting a Broad Area Cooling shield
  actively cooled by a cryocooler to see if IMLI can be used for the long-duration
  storage of liquid hydrogen with reduced boil-off.&lt;/div&gt;rn&lt;div&gt;rnt&amp;nbsp;&lt;/div&gt;rn&lt;div&gt;rnt&lt;div&gt;rnttNASA
  Marshall conducted the acoustic test, subjecting an IMLI blanket and shield identical
  to those used in the SMiRF tests to the vibrations and noise levels experienced
  during launch on a rocket. Use of this new insulation system supports NASA&amp;rsquo;s
  goal to achieve zero boil-off, which would help enable longduration missions as
  NASA develops new capabilities for&lt;/div&gt;rnt&lt;div&gt;rntthuman space exploration.
  On Earth, this superinsulation may one day be used in homes and factories&amp;mdash;reducing
  energy usage and furthering NASA&amp;rsquo;s mission to drive advances in science
  that benefit everyone.&lt;/div&gt;rn&lt;/div&gt;rn&lt;p&gt;rnt&amp;nbsp;&lt;/p&gt;rn\",\n\t\"license_title\":
